import React from "react";
import "./Persons.css";
import Sidenav from "./Sidenav";
import { Button } from "@material-ui/core";

const url = "http://localhost:8000/api/persons";

export default function HomePage() {
    var page = 0;
    var no_per_page = 10;
    function showAll() {
        fetch(url + "/get/" + page + "/" + no_per_page,{
            method: "GET",
            headers: {
                Accept: "application/json",
                Authorization: "Bearer " + localStorage.getItem("token"),
            }
        })
            .then((res) => res.json())
            .then((data) => {
                console.log(data);
            });
    }
    return (
        <div className="HomePage">
            <Sidenav/>
            <main>
                <Button variant="contained" className="buttonPerson">Add new person</Button>
                <Button variant="contained" className="buttonPerson">Search by name</Button>
                <Button variant="contained" className="buttonPerson">Search by cnp</Button>
                <Button variant="contained" className="buttonPerson" onClick={showAll}>Show all</Button>

            </main>
        </div>
    );
}
